INSERT INTO `article` VALUES (4374,'CNN\'s Chris Cillizza breaks down the best and worst performances from tonight\'s debate in Atlanta','http://rss.cnn.com/~r/rss/cnn_topstories/~3/uWfI0xKuv2c/index.html','2019-11-21 04:48:10',1,1,'The fifth Democratic debate of the 2020 presidential campaign is in the books.'),(4375,'In pictures: The Democratic debate in Atlanta','http://rss.cnn.com/~r/rss/cnn_topstories/~3/WhYP_0bwlvc/index.html','2019-11-21 04:21:14',1,1,'There are less than 11 weeks until the Iowa caucuses, and for some presidential candidates, Wednesday night\'s debate could have been the last chance for them to stand out in a crowded Democratic field.'),(4376,'Opinion: Who won','http://rss.cnn.com/~r/rss/cnn_topstories/~3/MW-ml_z4LgA/index.html','2019-11-21 05:01:07',1,1,'Democratic candidates for president took part in their party\'s fifth debate on Wednesday night in Atlanta and CNN commentators weighed in. The opinions expressed in these commentaries are those of the authors'),(4378,'Harris rips Gabbard: She spent four years on Fox News','http://rss.cnn.com/~r/rss/cnn_topstories/~3/dSvpnNceZ4Q/democratic-debate-atlanta-gabbard-criticism-orig-nws.cnn','2019-11-21 04:49:12',1,1,'In November\'s Democratic debate, Sen. Kamala Harris and Rep. Tulsi Gabbard tangled over Gabbard\'s criticism of the Democratic party.'),(4379,'Biden says he was endorsed by the only black woman elected to Senate (then corrects himself)','http://rss.cnn.com/~r/rss/cnn_topstories/~3/MqJ_b5LK3ro/h_0f3cf6c2165d8109f7c7e25ec5281845','2019-11-20 23:33:38',1,1,''),(4380,'Yang jokes: I\'d tell Putin, \'Sorry I beat your guy\'','http://rss.cnn.com/~r/rss/cnn_topstories/~3/L2Qo1u8NUf8/democratic-debate-yang-putin-foreign-policy-nws-orig.cnn','2019-11-21 05:34:24',1,1,'The 2020 Democratic presidential candidates were asked about President Trump\'s foreign policy at the MSNBC/The Washington Post debate in Atlanta, Georgia.'),(4382,'Klobuchar on a woman beating Trump: Pelosi does it every day','