additional charges Tuesday, according to the district attorney\'s office in Westmoreland County, Pennsylvania.'),(4392,'Report: Drugs found in home of NFL player after woman\'s apparent overdose','http://rss.cnn.com/~r/rss/cnn_topstories/~3/V3ZuSSKr5Sc/index.html','2019-11-21 03:32:17',1,1,'She arrived at a suburban Washington, DC, hospital around 1:30 a.m. Thursday unconscious and unresponsive. Julia E. Crabbe was suffering from an apparent overdose, authorities said.'),(4393,'Northern lights will be visible in US tonight','http://rss.cnn.com/~r/rss/cnn_topstories/~3/S5zh7JkK08M/index.html','2019-11-20 16:02:01',1,1,'Thanks to a minor geomagnetic storm, the northern lights may be visible in parts of the northern United States and across Canada on Wednesday night.'),(4395,'Opinion: On South Korea, Trump has seriously miscalculated','http://rss.cnn.com/~r/rss/cnn_topstories/~3/S24bNSRJpdE/index.html','2019-11-20 22:42:22',1,1,'According to a congressional aide and an administration official, the Trump administration has requested an approximate 400% increase in the amount South Korea contributes to the maintenance of United States forces in Korea -- the \"Special Measures Agreement,\" CNN reported on Thursday. (Secretary of Defense Mark Esper has refused to confirm this figure, simply saying, \"we have asked for a significant increase in the cost-sharing for our deployed troops.\") After last year\'s talks ended with a one-year agreement, rather than the longer agreements successfully negotiated nine times starting in 1991, it was expected that the talks would be difficult -- but this increase is not the start of a serious negotiation.'),(4396,'10-year-old boy who was shot at a high school football game dies','http://rss.cnn.com/~r/rss/cnn_topstories/~3/r_BWRs2fmHU/index.html','2019-11-21 04:27:44',1,1,'A 10-year-old boy who was injured when gunfire interrupted a New Jersey high school football game last week has died, prosecutors said Wednesday.'),(4399,'145 graves were discovered at a high school','http://rss.cnn.com/~r/rss/cnn_topstories/~3/y1Sc2vUPEG0/index.html','2019-11-21 06:04:17',1,1,'About 145 coffins believed to be part of a mid-20th century cemetery for the indigent were found buried under a Tampa, Florida, high school, officials said.'),(4400,'Steelers quarterback apologizes for his role in helmet-swinging brawl','http://rss.cnn.com/~r/rss/cnn_topstories/~3/cFThJjv9taA/index.html','2019-11-20 20:11:44',1,1,'Pittsburgh Steelers quarterback Mason Rudolph has apologized for his role in Thursday night\'s in-game brawl in which opponent Myles Garrett ripped off Rudolph\'s helmet and hit him in the head with it.'),(4401,'Homeless dad approaches police officers at bus depot and gets more than he asked for','http://rss.cnn.com/~r/rss/cnn_topstories/~3/e-vGW9nVNbk/index.html','2019-11-20 18:29:45',1,1,'It\'s not an uncommon sight: a man down on his luck asking for help at a city bus depot. People might avoid him or give him some spare change. Either way, he\'s often treated with suspicion.'),(4402,'Tom Hanks finds out he\'s related to star','http://rss.cnn.com/~r/rss/cnn_topstories/~3/XLdS5PodTCg/tom-hanks-mister-rogers-sixth-cousins-ancestry-es-vpx.cnn','2019-11-20 16:41:43',1,1,'Actor Tom Hanks is getting into character on a whole new level after finding out he is distantly related to Fred Rogers, who he is playing in an upcoming film.'),(4403,'Mother suing priest who spoke at her son\'s funeral','http://rss.cnn.com/~r/rss/cnn_topstories/~3/qf3zLQRK90c/index.html','2019-11-20 23:33:38',1,1,''),(4404,'Car bursts into flames at railroad crossing','http://rss.cnn.com/~r/rss/cnn_topstories/~3/7Qgp9fX3WsE/vehicle-explodes-flames-stafford-connecticut-llr-orig.cnn','2019-11-21 05:57:54',1,1,'The incident, captured by a security camera, occurred November 1 in Stafford, Connecticut.'),(4405,'How a family feud led to the creation of Asia\'s newest airline','http://rss.cnn.com/~r/rss/cnn_topstories/~3/l2bNZB674oQ/index.html','2019-1