//rss.cnn.com/~r/rss/cnn_topstories/~3/vM_RdcVWYxM/koala-rescue-australia-fires-orig-jk.cnn','2019-11-20 16:26:47',1,1,'Video shows a woman rescuing a koala from a bushfire in New South Wales. The koala has been treated for his burns and is still in \"very serious condition.\"'),(4424,'Trump and bribery claim: Does the shoe fit?','http://rss.cnn.com/~r/rss/cnn_topstories/~3/nlgwhOjljN8/index.html','2019-11-20 11:28:49',1,1,'For weeks, Americans have debated whether President Donald Trump\'s request that President Volodymyr Zelensky publicly announce the launch of investigations into former Vice President Joe Biden and his son, Hunter Biden, involved a quid pro quo. Recently, however, Speaker Nancy Pelosi dropped the Latin.'),(4425,'Chick-fil-A backlash is nothing short of \'cancel culture\'','http://rss.cnn.com/~r/rss/cnn_topstories/~3/uE7ogKQVmYg/index.html','2019-11-20 14:26:42',1,1,'Chick-fil-A is clucking about ending donations to religious, anti-LGBTQ organizations.'),(4426,'Stacey Abrams: The election issue that really counts','http://rss.cnn.com/~r/rss/cnn_topstories/~3/gHCv3a01VzQ/index.html','2019-11-20 11:18:52',1,1,'On Wednesday, the presidential candidates will gather for their next debate in Georgia, the location of one of the most egregious and successful voter suppression efforts in recent history. For those who value our nation\'s commitment to democracy, the issue of voter suppression is directly linked to whether the voice of the people is heard.'),(4427,'A must-have topic for the Democratic debate','http://rss.cnn.com/~r/rss/cnn_topstories/~3/5skbX4VHx1s/index.html','2019-11-20 20:53:09',1,1,'Wednesday\'s Democratic presidential debate must go beyond the intensive focus on impeachment that has seized our public debate in recent weeks to address other urgent issues facing the country. There is much to talk about -- health care, the climate crisis, creating well-paying jobs, and more. But one issue that has received short shrift is the need to reduce and refocus the Pentagon\'s massive budget. With a more realistic strategy and more disciplined spending practices, the country could be made considerably safer while spending less on the Department of Defense.'),(4428,'Venice is sinking and this time it may go under','http://rss.cnn.com/~r/rss/cnn_topstories/~3/irlhhogQqT4/index.html','2019-11-15 14:04:26',1,1,'Venice is sinking. In a way this isn\'t news. The mere survival of Venice in 2019 is a testament to the determination, ingenuity, collaboration, and ferocity of humans seeking to eke out a life in hostile environments.'),(4429,'Call T.I. taking his daughter for a \'virginity test\' what it really is','http://rss.cnn.com/~r/rss/cnn_topstories/~3/kwW2ZuHvWjw/index.html','2019-11-19 15:50:50',1,1,'Earlier this month, rapper T.I. told the hosts of the \"Ladies Like Us\" podcast that his idea of \"sex education\" goes far beyond having the \"sex talk\" with his 18-year-old-college freshman daughter.'),(4431,'9 cards charging 0% interest until 2021','http://rss.cnn.com/~r/rss/cnn_topstories/~3/PQ6-Y95W9Jo/pay-0-interest-until-2021','2019-11-20 23:33:38',1,1,''),(4432,'Apple\'s $7 trillion bet','http://rss.cnn.com/~r/rss/cnn_topstories/~3/SapmO-hbXhc/advert-rb-ahc','2019-11-20 23:33:38',1,1,''),(4443,'Pregnant woman killed by dogs while walking in French forest during hunt','http://rss.cnn.com/~r/rss/cnn_world/~3/jJIQCqRKl1o/index.html','2019-11-20 20:02:24',1,2,'A pregnant woman was killed by dogs in a forest in France as a hunt took place nearby, investigators have said.'),(4444,'Prince Andrew steps back from public duties','http://rss.cnn.com/~r/rss/cnn_world/~3/1C3TzYCDwAo/index.html','2019-11-20 20:47:45',1,2,'Prince Andrew has said that the Queen has given him permission to step back from public duties \"for the foreseeable future\" following a firestorm of criticism over an interview about his association with convicted sex offender Jeffrey Epstein.'),(4445,'India\'s \'living bridges\' get stronger as they