r/rss/cnn_world/~3/VhF7dbM16ko/index.html','2019-11-20 05:42:45',1,2,'Aston Martin unveiled its first SUV Tuesday in Los Angeles and at a simultaneous event in Beijing. The British sports car company joins a long list of brands, including Lamborghini, Bentley and Rolls-Royce, for which an SUV would have once been unthinkable, but is now a reality.'),(4456,'Inside a supermodel\'s stunning Florida home','http://rss.cnn.com/~r/rss/cnn_world/~3/KLPtkT7KuRs/index.html','2019-11-19 15:13:10',1,2,'It\'s not every day you get to look inside a supermodel\'s luxury home. But Elle Macpherson has offered a rare glimpse of her chic Florida house by opening her doors to Architectural Digest.'),(4457,'Dora Maar is no longer Picasso\'s \'Weeping Woman\'','http://rss.cnn.com/~r/rss/cnn_world/~3/qRTMTElj9v8/index.html','2019-11-20 12:50:06',1,2,'\"I must dwell apart in the desert,\" the artist and surrealist photographer Dora Maar once said. \"I want to create an aura of mystery about my work. People must long to see it.'),(4464,'Europe\'s most beautiful winter city','http://rss.cnn.com/~r/rss/cnn_world/~3/mlED52O1aVQ/index.html','2019-11-19 14:30:03',1,2,'Budapest is fast becoming one of Europe\'s leading travel destinations, especially in winter when Hungary\'s capital city truly comes to life.'),(4465,'What we learned from the world\'s longest flight','http://rss.cnn.com/~r/rss/cnn_world/~3/tdmBRbRHWjU/index.html','2019-11-16 10:47:06',1,2,'It feels like the world just got that bit smaller. A flight operated by Australian airline Qantas has just made the record-breaking trip from London to Sydney nonstop, spending 19 hours and 19 minutes in the air and opening up the possibility of scheduled direct flights between some of the farthest corners of the planet.'),(4466,'The world\'s most beautiful places','http://rss.cnn.com/~r/rss/cnn_world/~3/Wr40lS8M7zI/index.html','2019-11-19 14:34:12',1,2,'The world\'s a spectacular place, full of hidden and overt beauty in every corner. But beau